INSERT INTO `foodShow0201` VALUES (2,'yykim','부족함 없는 도가니탕 먹방','<span style=\"font-family: 바탕체, batangche; font-size: 24pt; background-color: rgb(51, 51, 204); color: rgb(255, 255, 255);\">따뜻한 날 좋은 도가니탕 먹방입니다 ^^</span>','2018-11-29 14:02:59',5,'##JMT#먹방#도가니탕#허미노','https://www.youtube.com/embed/bspA3Pa0WGw'),(3,'yykim','버섯 리조또','<p><span style=\"font-size: 18pt;\"><i><span style=\"background-color: rgb(255, 255, 255); color: rgb(207, 204, 162);\">몸에도 좋고 건강에도 좋은 버섯 리조또 예요 ~ㅎㅎ</span></i></span></p><p><span style=\"font-size: 18pt;\"><i><span style=\"background-color: rgb(255, 255, 255); color: rgb(207, 204, 162);\">다들 맛접 ^^</span></i></span></p>','2018-11-29 14:09:30',18,'##버섯#리조또#JMT#먹방#다린살롱','https://www.youtube.com/embed/fLAANBLOmXs'),(4,'joobee','수제 당근 케이크 먹방 !!','<div style=\"text-align: center; \" align=\"center\"><span style=\"color: rgb(239, 0, 124);\">직접 만들고 먹는 먹방입니다 ^_^</span></div><div style=\"text-align: center; \" align=\"center\"><span style=\"color: rgb(239, 0, 124);\">종강 하고 홈베이킹으로 당근 케이크 만들어 먹는건 어떨까요 ?&nbsp;</span></div><div style=\"text-align: center;\" align=\"center\"><br></div><div style=\"text-align: center; \" align=\"center\"><span style=\"color: rgb(239, 0, 124);\">다들 좋은 하루 보내세요 ~^^ 총총</span></div>','2018-11-29 14:13:43',3,'##당근케이크#케이크#존맛#수제#DIY','https://www.youtube.com/embed/IyQu6VhCN1M'),(5,'joobee','아가 유자청 먹방','<p style=\"text-align: center; \" align=\"center\"><span style=\"font-size: 11pt; color: rgb(255, 255, 255); background-color: rgb(255, 167, 0);\">귀여운 친구의 유자청 먹방입니다 ㅎㅎ</span></p><p style=\"text-align: center; \" align=\"center\">&nbsp;</p><p style=\"text-align: center; \" align=\"center\"><span style=\"font-size: 11pt; color: rgb(255, 255, 255); background-color: rgb(255, 167, 0);\">추운 겨울날 감기에도 좋은 유자청 !</span></p><p style=\"text-align: center; \" align=\"center\">&nbsp;</p><p style=\"text-align: center; \" align=\"center\"><span style=\"font-size: 11pt; color: rgb(255, 255, 255); background-color: rgb(255, 167, 0);\">다들 전기장판 위에서 유자차 한잔 어떤가요&nbsp;</span></p>','2018-11-29 14:16:57',3,'##유자차#유자청#감기#베이비','https://www.youtube.com/embed/cvsHAJziimM'),(6,'joobee','도로시의 피자 먹방 !!','<p><span style=\"font-size: 24pt; background-color: rgb(217, 238, 236); font-family: 나눔고딕, NanumGothic, sans-serif;\">도로시 언니의 먹방이예요 !!</span></p><p>&nbsp;</p><p><span style=\"font-size: 24pt; background-color: rgb(217, 238, 236); font-family: 나눔고딕, NanumGothic, sans-serif;\">저도 피자랑 스파게티 먹고싶네요 ㅠㅠ&nbsp;</span></p><p>&nbsp;</p><p><span style=\"font-size: 24pt; background-color: rgb(217, 238, 236); font-family: 나눔고딕, NanumGothic, sans-serif;\">같이 도로시 언니 먹방 보러가요 총총</span></p>','2018-11-29 14:20:25',26,'##도로시#먹방#존맛#피자#JMT#스파게티','https://www.youtube.com/embed/ibRtBpKHzEo'),(7,'hong','쌀쌀할 땐 차한잔 어때요 ?','<p><span style=\"color: rgb(255, 239, 0);\"><b><strike>따뜻하게 마실 수 있는 고구마라떼예요 !!</strike></b></span></p><p><b><strike><br></strike></b></p><p><span style=\"color: rgb(255, 239, 0);\"><b><strike>쉽게 만들 수 있는 고구마라떼 !!</strike></b></span></p><p><b><strike><br></strike></b></p><p><span style=\"color: rgb(255, 239, 0);\"><b><strike>다함께 마셔봐요 !!</strike></b></span></p>','2018-11-29 14:23:43',1,'##고구마#라떼#고구마라떼#존맛#먹방','https://www.youtube.com/embed/VHEovQi0yRM'),(8,'hong','신전 떡볶이 먹방','<p><span style=\"font-size: 24pt; color: rgb(0, 117, 200);\">슈기님 먹방입니다 정말 맛있겠네요 !</span></p><p>&nbsp;</p><p><span style=\"font-size: 24pt; color: rgb(0, 117, 200);\">저는 신전 주문하러 갑니다 ^^</span></p>','2018-11-29 14:26:24',5,'##신전#떡볶이#존맛#먹방#슈기#JMT','https://www.youtube.com/embed/xJs-dWKJyFA'),(9,'hong','밴쯔 떡볶이 먹방','<p style=\"text-align: center; \" align=\"center\"><b><span style=\"background-color: rgb(109, 48, 207); color: rgb(255, 255, 255); font-size: 12pt;\">신전 시키고 다시 돌아왔습니다 !!</span></b></p><p style=\"text-align: center; \" align=\"center\"><b><br></b></p><p style=\"text-align: center; \" align=\"center\"><b><span style=\"background-color: rgb(109, 48, 207); color: rgb(255, 255, 255); font-size: 12pt;\">잘 시키켰네요 역시 명불허전 밴쯔님입니다 ^^b</span></b></p>','2018-11-29 14:27:59',4