t-size: 12pt;\"><a href=\"https://terms.naver.com/entry.nhn?docId=1993274&amp;ref=y\"><span lang=\"KO\" style=\"font-size:10.5pt\">소금</span></a></span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">(</span><span style=\"font-size: 10.5pt;\">소금 약간<span lang=\"EN-US\">)</span></span></div></span><span style=\"font-size:10.5pt\"><div style=\"text-align: center;\"><strong style=\"font-size: 10.5pt;\">· 재료설명<span lang=\"EN-US\"> :</span></strong><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> </span><span style=\"font-size: 10.5pt;\">누린내제거</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> (</span><span style=\"font-size: 10.5pt;\">마늘</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> , </span><span style=\"font-size: 10.5pt;\">대파</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> , </span><span style=\"font-size: 10.5pt;\">후추</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> , </span><span style=\"font-size: 10.5pt;\">월계수잎</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">)</span></div><strong><div style=\"text-align: center;\"><strong style=\"font-size: 10.5pt;\">· 대체재료<span lang=\"EN-US\"> :</span></strong><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> </span><span style=\"font-size: 10.5pt;\">소금 → 재래간장</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> (</span><span style=\"font-size: 10.5pt;\">개인의 기호에 따라 재래간장으로 간을 하여도 좋다</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">.)</span></div></strong></span><p></p>\r\n\r\n<h4 style=\"text-align: center; line-height: 18.75pt;\"><span lang=\"EN-US\" style=\"color:#333333\">2) </span><span style=\"color:#333333\">기본정보<span lang=\"EN-US\"><o:p></o:p></span></span></h4>\r\n\r\n<p class=\"txt1\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><strong style=\"font-size: 12pt;\"><span style=\"font-size: 10.5pt;\">· 조리시간<span lang=\"EN-US\"> :</span></span></strong><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> 360</span><span style=\"font-size: 10.5pt;\">분</span></div><span style=\"font-size:10.5pt\"><div style=\"text-align: center;\" align=\"center\"><strong style=\"font-size: 10.5pt;\">· 분량<span lang=\"EN-US\"> :</span></strong><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> 8</span><span style=\"font-size: 10.5pt;\">회분 기준</span></div><strong><div style=\"text-align: center;\" align=\"center\"><strong style=\"font-size: 10.5pt;\">· 칼로리<span lang=\"EN-US\"> :</span></strong><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> 462<span class=\"uworddic2\">kcal</span>\r\n(1</span><span style=\"font-size: 10.5pt;\">인분</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">)</span></div></strong></span><p></p>\r\n\r\n<h4 style=\"text-align: center; line-height: 18.75pt;\"><span lang=\"EN-US\" style=\"color:#333333\">3) </span><span style=\"color:#333333\">요리과정<span lang=\"EN-US\"><o:p></o:p></span></span></h4>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434655221543465522274_doga1.jpg\" title=\"15434655221543465522274_doga1.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\">01.</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"> </span><span style=\"font-size:10.5pt\">도가니뼈는\r\n물에 헹군 후 볼에 도가니 뼈와 잠길 정도의 물을 담아 냉장실에서 하룻동안 핏물을 뺀다<span lang=\"EN-US\">. </span>체에 밭쳐\r\n물기를 뺀다<span lang=\"EN-US\">.(</span>중간에 물을 갈아주며 핏물을 뺀다<span lang=\"EN-US\">.)<o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434655481543465548340_doga2.jpg\" title=\"15434655481543465548340_doga2.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\">02.</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"> </span><span style=\"font-size:10.5pt\">큰 냄비에\r\n도가니 뼈가 잠길 만큼 물을 붓고 바글바글 끓어오르면 도가니 뼈를 넣고<span lang=\"EN-US\"> 10</span>분간 데친 다음 체에 밭쳐\r\n흐르는 물에 헹군다<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434655791543465579293_doga3.jpg\" title=\"15434655791543465579293_doga3.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\">03.</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"> </span><span style=\"font-size:10.5pt\">냄비에 도가니\r\n뼈<span lang=\"EN-US\">, </span>물<span lang=\"EN-US\"> 18</span>컵<span lang=\"EN-US\">, </span>대파<span lang=\"EN-US\">, </span>통 후추<span lang=\"EN-US\">, </span>마늘<span lang=\"EN-US\">, </span>월계수잎을\r\n넣고 센 불에서 바글바글 끓어오르면 약한 불로 줄여 뚜껑을 덮고<span lang=\"EN-US\"> 5~6</span>시간 동안 뭉근히 끓인다<span lang=\"EN-US\">. </span>중간중간에 기름과 거품을 걷어낸다<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434656051543465605820_doga4.jpg\" title=\"15434656051543465605820_doga4.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\">04.</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"> </span><span style=\"font-size:10.5pt\">체에 걸려\r\n국물은 따로 두고 도가니 뼈의 살과 물렁뼈를 발라낸다<span lang=\"EN-US\">. </span>냄비에 국물과 발라낸 살과 물렁뼈를 넣고 끓인다<span lang=\"EN-US\">. </span>차게 식힌 후 기름을 걷어낸다<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434656151543465615760_doga5.jpg\" title=\"15434656151543465615760_doga5.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\">05.</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"> </span><span style=\"font-size:10.5pt\">대파는 송송\r\n썬다<span lang=\"EN-US\">. 04</span>를 다시 끓인 후 대파<span lang=\"EN-US\">, </span>소금을 곁들인다<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<!--EndFragment--><div style=\"text-align: center;\"><br></div>','2018-11-29 13:26:59',14,'##도가니탕#뚝배기#하실래여#맛있탕#뚝딱'),(9,'chy','버섯리조또 레시피~!','<!--[if 