pan>컵<span lang=\"EN-US\">, </span>참기름<span lang=\"EN-US\"> 1</span>작은술<span lang=\"EN-US\">, </span>소금 약간<span lang=\"EN-US\">, </span>후춧가루 약간<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 18.75pt; word-break: keep-all;\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:\r\n굴림;mso-bidi-font-family:굴림;color:#333333;mso-font-kerning:0pt\">2) </span></b><b><span style=\"font-size:12.0pt;font-family:굴림;mso-bidi-font-family:굴림;color:#333333;\r\nmso-font-kerning:0pt\">기본정보<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n\r\n<p class=\"MsoNormal\" align=\"left\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;text-align:left;line-height:18.75pt;mso-pagination:widow-orphan;\r\ntext-autospace:ideograph-numeric ideograph-other;word-break:keep-all\"></p><div style=\"text-align: center;\" align=\"center\"><b style=\"font-size: 10pt;\"><span style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림;color:#333333;\r\nmso-font-kerning:0pt\">· 조리시간<span lang=\"EN-US\"> :</span></span></b><span lang=\"EN-US\" style=\"font-size: 10.5pt; font-family: 굴림; color: rgb(51, 51, 51);\"> 40</span><span style=\"font-size: 10.5pt; font-family: 굴림; color: rgb(51, 51, 51);\">분</span></div><span style=\"font-size:10.5pt;\r\nfont-family:굴림;mso-bidi-font-family:굴림;color:#333333;mso-font-kerning:0pt\"><div style=\"text-align: center;\" align=\"center\"><b style=\"font-size: 10.5pt;\">· 분량<span lang=\"EN-US\"> :</span></b><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> 4</span><span style=\"font-size: 10.5pt;\">인분 기준</span></div></span><p></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 18.75pt; word-break: keep-all;\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:\r\n굴림;mso-bidi-font-family:굴림;color:#333333;mso-font-kerning:0pt\">3) </span></b><b><span style=\"font-size:12.0pt;font-family:굴림;mso-bidi-font-family:굴림;color:#333333;\r\nmso-font-kerning:0pt\">요리과정<span lang=\"EN-US\"><o:p></o:p></span></span></b></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 18.75pt; word-break: keep-all;\"><b><span style=\"font-size:12.0pt;font-family:굴림;mso-bidi-font-family:굴림;color:#333333;\r\nmso-font-kerning:0pt\"><br></span></b></p>\r\n\r\n<p class=\"MsoNormal\" align=\"left\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:left;line-height:18.75pt;mso-pagination:widow-orphan;text-autospace:\r\nideograph-numeric ideograph-other;word-break:keep-all\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434658621543465862213_mush1.jpg\" title=\"15434658621543465862213_mush1.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 18.75pt; word-break: keep-all;\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림;\r\ncolor:#333333;mso-font-kerning:0pt\">01.</span></b><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림;color:#333333;\r\nmso-font-kerning:0pt\"> </span><span style=\"font-size:10.5pt;font-family:굴림;\r\nmso-bidi-font-family:굴림;color:#333333;mso-font-kerning:0pt\">쌀은 깨끗이 씻어<span lang=\"EN-US\"> 30</span>분간 찬물에 담가 불린 뒤 체에 받쳐 물기를 뺀다<span lang=\"EN-US\">.<o:p></o:p></span></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 18.75pt; word-break: keep-all;\"><span style=\"font-size:10.5pt;font-family:굴림;\r\nmso-bidi-font-family:굴림;color:#333333;mso-font-kerning:0pt\"><span lang=\"EN-US\"><br></span></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"left\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:left;line-height:18.75pt;mso-pagination:widow-orphan;text-autospace:\