-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림;color:#333333;\r\nmso-font-kerning:0pt\"> </span><span style=\"font-size:10.5pt;font-family:굴림;\r\nmso-bidi-font-family:굴림;color:#333333;mso-font-kerning:0pt\">달군 팬에 올리브 오일을 두르고 불린\r\n쌀을 넣어 향이 배도록 볶는다<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; margin-bottom: 0.0001pt; line-height: 18.75pt; word-break: keep-all;\">&nbsp;</p><p class=\"MsoNormal\" align=\"left\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:left;line-height:18.75pt;mso-pagination:widow-orphan;text-autospace:\r\nideograph-numeric ideograph-other;word-break:keep-all\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434658971543465897620_mush4.jpg\" title=\"15434658971543465897620_mush4.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; line-height: 18.75pt; word-break: keep-all;\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림;\r\ncolor:#333333;mso-font-kerning:0pt\">04.</span></b><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림;color:#333333;\r\nmso-font-kerning:0pt\"> </span><span style=\"font-size:10.5pt;font-family:굴림;\r\nmso-bidi-font-family:굴림;color:#333333;mso-font-kerning:0pt\">여기에 버섯과 육수를 넣어 중 불에서\r\n저어가며 끓이다 쌀알이 투명해지면 닭가슴살을 넣어 가볍게 섞어가며 끓인다<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center; margin-bottom: 0.0001pt; line-height: 18.75pt; word-break: keep-all;\">&nbsp;</p><p class=\"MsoNormal\" align=\"left\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:left;line-height:18.75pt;mso-pagination:widow-orphan;text-autospace:\r\nideog