ackground: rgb(254, 254, 254);\" align=\"center\"><em><b><span lang=\"EN-US\" style=\"font-size:8.5pt;color:white\">How To </span></b></em><em><b><span style=\"font-size:8.5pt;color:white\">동영상</span></b></em><b><span style=\"font-size:11.0pt;color:#333333\"> 다시마 멸치 육수내기<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 2</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434795161543479516395_dbe2.jpg\" title=\"15434795161543479516395_dbe2.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">국물 재료를\r\n센 불에 올려 끓어오르면 떡볶이떡을 넣고<span lang=\"EN-US\"> 3~4</span>분간 끓여줍니다<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 3</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div styl