pan>설탕<span lang=\"EN-US\">(</span>흰설탕<span lang=\"EN-US\">) 1</span>컵<span lang=\"EN-US\">, </span>포도씨유<span lang=\"EN-US\"> 1/2</span>컵<span lang=\"EN-US\">, </span>계핏가루<span lang=\"EN-US\"> 1/2</span>작은술<span lang=\"EN-US\">, </span>베이킹파우더<span lang=\"EN-US\"> 1</span>작은술<span lang=\"EN-US\">, </span>다진호두<span lang=\"EN-US\"> 1/2</span>컵</span></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 14px;\"><br></span></div><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"><div style=\"text-align: center;\" align=\"center\"><strong style=\"font-size: 10.5pt;\">휘핑크림 재료</strong><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">- </span><span style=\"font-size: 10.5pt;\">생크림</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> 1/4</span><span style=\"font-size: 10.5pt;\">컵</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">, </span><span style=\"font-size: 10.5pt;\">설탕</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">(</span><span style=\"font-size: 10.5pt;\">흰설탕</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">) 1</span><span style=\"font-size: 10.5pt;\">작은술</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">, </span><span style=\"font-size: 10.5pt;\">크림치즈</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"> 300g, </span><span style=\"font-size: 10.5pt;\">오렌지잼</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">(</span><span style=\"font-size: 10.5pt;\">생략가능</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">) 1</span><span style=\"font-size: 10.5pt;\">큰술</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">, </span><span style=\"font-size: 10.5pt;\">로즈메리</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">(</span><span style=\"font-size: 10.5pt;\">생략가능</span><span lang=\"EN-US\" style=\"font-size: 10.5pt;\">) </span><span style=\"font-size: 10.5pt;\">약간</span></div>\r\n\r\n</span><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; margin-bottom: 12pt; line-height: 18.75pt;\" align=\"center\"><em><b style=\"mso-bidi-font-weight:normal\"><span lang=\"EN-US\" style=\"font-size:16.0pt;\r\nmso-bidi-font-size:12.0pt\">2.</span></b></em><b style=\"mso-bidi-font-weight:\r\nnormal\"><span lang=\"EN-US\" style=\"font-size:16.0pt;mso-bidi-font-size:12.0pt\"> </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:16.0pt;mso-bidi-font-size:\r\n12.0pt\">만드는 법</span></b><b style=\"mso-bidi-font-weight:normal\"><span lang=\"EN-US\" style=\"font-size:16.0pt;mso-bidi-font-size:13.5pt\"><o:p></o:p></span></b></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 1</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434796661543479666326_dg1.jpg\" title=\"15434796661543479666326_dg1.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">호두는 굵게\r\n다지고<span lang=\"EN-US\">, </span>당근은 강판에 갈거나 칼로 곱게 채썰어주세요<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 2</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\">&nbsp;</p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434796791543479679094_dg2.jpg\" title=\"15434796791543479679094_dg2.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">볼에 달걀을\r\n넣고<span lang=\"EN-US\"> 30</span>초간 거품기로 달걀을 풀어주세요<span lang=\"EN-US\">. </span>설탕을 조금씩\r\n넣으면서 섞은 후 포도씨유를 넣어 섞어주세요<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\"><br></span></b></span></p><p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 3</span></strong></p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434796871543479687498_dg3.jpg\" title=\"15434796871543479687498_dg3.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">밀가루와 베이킹파우더<span lang=\"EN-US\">, </span>계핏가루를 체에 쳐서 넣고 섞은 후<span lang=\"EN-US\">, </span>당근과 호두를 넣고 반죽과\r\n섞어주세요<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\"><br></span></b></span></p><p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 4</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434797021543479702232_dg4.jpg\" title=\"15434797021543479702232_dg4.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">약간의 포도씨유를\r\n밥솥 바닥에 골고루 바르고<span lang=\"EN-US\">, </span>반죽을 부어 준 후 밥솥을 바닥에 탕탕 친 후 만능찜기능버튼<span lang=\"EN-US\">(50</span>분<span lang=\"EN-US\">)</span>을 눌러 익혀주세요<span lang=\"EN-US\">. (</span>나무꼬치로\r\n살짝 찔러 반죽이 묻어 나오지 않을 때까지 익혀주세요<span lang=\"EN-US\">) <o:p></o:p></span></span></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\"><br></span></b></span></p><p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 5</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434797141543479714451_dg5.jpg\" title=\"15434797141543479714451_dg5.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434799061543479906176_dg5_1.jpg\" title=\"15434799061543479906176_dg5_1.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">볼에 생크림을\r\n넣고 핸드믹서기로 휘핑하면서 설탕을 넣어주세요<span lang=\"EN-US\">. </span>또 다른 볼에 크림치즈를 넣고 핸드믹서기로 풀어준 후<span lang=\"EN-US\">, </span>휘핑한 생크림을 섞어 휘핑 크림을 만들어 주세요<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\"><br></span></b></span></p><p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 6</span></strong><span lang=\"EN-US\" style=\"font-size:10.5pt\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434799431543479943963_dg6_1.jpg\" title=\"15434799431543479943963_dg6_1.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434799721543479972935_dg6_2.jpg\" title=\"15434799721543479972935_dg6_2.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434799811543479981401_dg6.jpg\" title=\"15434799811543479981401_dg6.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434800101543480010221_dg6_3.jpg\" title=\"15434800101543480010221_dg6_3.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">당근케이크시트\r\n꺼내 한김 식힌 후 시트를 가로로<span lang=\"EN-US\"> 3</span>등분 해주세요<span lang=\"EN-US\">. </span>시트가\r\n다 식으면 자른 시트면에 휘핑한 크림을 펴 발라준 후 시트를 올리고<span lang=\"EN-US\">, </span>제일 윗면에는 휘핑한 크림을 펴\r\n발라주세요<span lang=\"EN-US\">. (</span>휘핑크림을 비닐팩에 넣어 원을 그리면서 올려주면 일정한 양의 크림을 올려줄 수 있어요<span lang=\"EN-US\">) <o:p></o:p></span></span></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\"><br></span></b></span></p><p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span class=\"uworddic2\"><b><span lang=\"EN-US\" style=\"font-size:10.5pt\">STEP</span></b></span><strong><span lang=\"EN-US\" style=\"font-size:10.5pt;font-family:굴림;mso-bidi-font-family:굴림\"> 7</span></strong></p><p class=\"MsoNormal\" style=\"line-height:18.75pt\"></p><div style=\"text-align: center;\" align=\"center\"><img src=\"http://localhost:8090/editor/popup/upload/15434800211543480021669_dg7.jpg\" title=\"15434800211543480021669_dg7.jpg\" style=\"font-size: 10pt;\"></div><div style=\"text-align: center;\" align=\"center\"><span style=\"font-size: 10pt;\">&nbsp;</span></div><p></p>\r\n\r\n<p class=\"txt1\" style=\"text-align: center; line-height: 18.75pt;\" align=\"center\"><span style=\"font-size:10.5pt\">당근케이크에\r\n오렌지잼과 로즈메리를 이용해서 당근모양으로 장식해주셔도 좋아요<span lang=\"EN-US\">.<o:p></o:p></span></span></p>\r\n\r\n<!--EndFragment--><div style=\"text-align: center;\"><br></div>','2018-11-29 17:27:09',9,'##당근케이크#케이크#존맛#수제#DIY');
