g=\"EN-US\">, </span>포장 손님이 훨씬 더 많은 가게였어요<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><img src=\"http://localhost:8090/editor/popup/upload/15434628611543462861204_sopung_1.jpg\" title=\"15434628611543462861204_sopung_1.jpg\"><br style=\"clear:both;\"><br>&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"line-height: 14.2667px;\">이 가게에서<span lang=\"EN-US\">&nbsp;best</span>메뉴는&nbsp;<span lang=\"EN-US\">‘</span>밥도둑김밥<span lang=\"EN-US\">’</span>인데 계란김밥으로도 많이 불린다고 해요<span lang=\"EN-US\">!!<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 14.2667px;\">사진처럼 계란지단 속에 살짝 매운 소스로 양념된 어묵이 들어간 김밥이에요<span lang=\"EN-US\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 14.2667px;\">계란과 매운 어묵만으로 이런 맛<span lang=\"EN-US\">… JMT….&nbsp;</span>♥<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 14.2667px;\">요즘 일반 김밥도&nbsp;<span lang=\"EN-US\">2,500</span>원 이상인데<span lang=\"EN-US\"><br></span>이렇게 알찬 내용물로 구성된 김밥을&nbsp;<span lang=\"EN-US\">2,000</span>원부터<span lang=\"EN-US\">&nbsp;3,500</span>원 사이의 가격에 맛볼 수 있어서 더욱 마음에 들었어요<span lang=\"EN-US\">.&nbsp;</span>어떤 곳은 김밥 한 줄에&nbsp;<span lang=\"EN-US\">5,000</span>원<span lang=\"EN-US\">…</span>ㅠㅠ<span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 14.2667px;\">가격<span lang=\"EN-US\">.&nbsp;</span>맛<span lang=\"EN-US\">.&nbsp;</span>모두 만족스러웠습니다<span lang=\"EN-US\">!!</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><br><br><br><br><img src=\"http://localhost:8090/editor/popup/upload/15434628611543462861208_sopung_2.jpg\" title=\"15434628611543462861208_sopung_2.jpg\"><br style=\"clear:both;\">&nbsp;</span></p><p class=\"MsoNormal\"></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\">영업시간<span lang=\"EN-US\">&gt;&gt; </span>월요일 휴무<span lang=\"EN-US\">,\r\n</span>화수목금 <span lang=\"EN-US\">07:00~20:30, </span>주말 및 공휴일 <span lang=\"EN-US\">08:00~19:00,\r\n</span>브레이크타임 <span lang=\"EN-US\">14:00~16:00<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">영업시간은 이렇다고 하네요<span lang=\"EN-US\">! </span>참고하시면 좋을 것 같아요 ㅎㅎㅎㅎ</p>\r\n\r\n<!--EndFragment--><br>','2018-11-29 12:42:27',9,'서울특별시 관악구 봉천로 605','##낙성대맛집#김밥맛집#계란김밥#밥도둑김밥#푸짐해요#김밥','소풍가는날'),(4,'chy','[안국역] AFTER WORK 33 파스타 맛집!!','\r\n\r\n\r\n\r\n\r\n\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:DrawingGridVerticalSpacing>10 pt</w:DrawingGridVerticalSpacing>\r\n  <w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery>\r\n  <w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>KO</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:SpaceForUL/>\r\n   <w:BalanceSingleByteDoubleByteWidth/>\r\n   <w:DoNotLeaveBackslashAlone/>\r\n   <w:ULTrailSpace/>\r\n   <w:DoNotExpandShiftReturn/>\r\n   <w:AdjustLineHeightInTable/>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n  