f]-->\r\n\r\n\r\n\r\n<!--StartFragment-->\r\n\r\n<p class=\"MsoNormal\">&nbsp;</p><p class=\"MsoNormal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\">안녕하세용<span lang=\"EN-US\">! </span>오늘은 파스타 맛집으로 유명한 안국역 <span lang=\"EN-US\">‘AFTER WORK33’ </span>소개해드릴게요<span lang=\"EN-US\">~!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">위치는 지도 어플 켜고 보면서 찾아가시는 걸 추천드려요ㅠㅠ 골목에 있는 가게인데<span lang=\"EN-US\">, </span>약간 갑<span lang=\"EN-US\">.</span>분<span lang=\"EN-US\">.</span>파<span lang=\"EN-US\">.(</span>갑자기 분위기 파스타가게<span lang=\"EN-US\">)… </span>가게 주변이 빌라<span lang=\"EN-US\">, </span>작은 가게들이 많아서 처음 가시는 분들은 찾기 힘들 수 있을 것 같아요<span lang=\"EN-US\">!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">영업시간<span lang=\"EN-US\">&gt;&gt; </span>매일 <span lang=\"EN-US\">11:30~23:00<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">파스타도 맛있었지만<span lang=\"EN-US\">, </span>인테리어가 참 마음에 들었던 곳이에요<span lang=\"EN-US\">… </span>♥<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">아기자기하면서도 클래식한 느낌<span lang=\"EN-US\">? </span>분위기가 정말 좋았어요<span lang=\"EN-US\">!!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p><img src=\"http://localhost:8090/editor/popup/upload/15434640941543464094764_ankuk1.jpg\" title=\"15434640941543464094764_ankuk1.jpg\"><br style=\"clear:both;\"><br><br><img src=\"http://localhost:8090/editor/popup/upload/15434640941543464094769_ankuk2.jpg\" title=\"15434640941543464094769_ankuk2.jpg\"><br style=\"clear:both;\"><br></o:p></span></p><p class=\"MsoNormal\"></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p><br></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p><br></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">*** </span>런치타임 이벤트 <span lang=\"EN-US\">***<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">평일 <span lang=\"EN-US\">11:30~13:30 </span>사이에 주문하는 것에 적용되는 이벤트라고\r\n하네요<span lang=\"EN-US\">!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">특히 이 시간대에 주문하면 파스타<span lang=\"EN-US\">/</span>리조또<span lang=\"EN-US\">/</span>라이스를 단돈 <span lang=\"EN-US\">8</span>천원에<span lang=\"EN-US\">!!!!!!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">진짜 여기 너무 최고 아닌가요 ㅠㅠ<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">저는 런치타임에 방문하여 친구랑 로제 파스타<span lang=\"EN-US\">, </span>봉골레 파스타를 주문했어요<span lang=\"EN-US\">.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">사실 가게와 상관없이 어딜 가든 저렇게 주문하는 우리 둘<span lang=\"EN-US\">….<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">로제 파스타에 소스도 아낌없이 주시고<span lang=\"EN-US\">, </span>봉골레는<span lang=\"EN-US\">…. JMTGR!!!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">조개도 많이 들어가 있어서 더 좋았습니다 ♥<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">다른 메뉴도 도전하셔서 같이 공유해요<span lang=\"EN-US\">~</span></p>','2018-11-29 13:01:45',7,'서울특별시 종로구 율곡로10길 21','##안국역맛집#파스타맛집#분위기최고#파스타#런치타임#숨은맛집','AFTER WORK 33'),(6,'yykim','[연남동] 오복수산 _ 카이센동 맛집!!','\r\n\r\n\r\n\r\n\r\n\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:DrawingGridVerticalSpacing>10 pt</w:DrawingGridVerticalSpacing>\r\n  <w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery>\r\n  <w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r