ormal\">오복수산 매장은 바테이블과 일반 테이블이 있는데<span lang=\"EN-US\">, 10</span>명 정도 들어가면\r\n꽉 찰 것 같았어요<span lang=\"EN-US\">.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">이곳 시그니처 메뉴는 <span lang=\"EN-US\">‘</span>카이센동<span lang=\"EN-US\">’</span>이라고\r\n합니당<span lang=\"EN-US\">!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">(</span>그래놓고 카이센동 아닌 <span lang=\"EN-US\">‘</span>사케\r\n우니 이쿠라동<span lang=\"EN-US\">’ </span>주문함<span lang=\"EN-US\">…)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">아니 이 맛은<span lang=\"EN-US\">…<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">삿포로에서 먹었던 카이센동이 떠오르는 정말 감동적인 맛이에요 ㅠㅠ<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">해산물 좋아하시는 분들<span lang=\"EN-US\">, </span>익히지 않은 해산물 좋아하시는 분들에게 강추드려요\r\n♥<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">이정도 퀄리티와 양에 이런 가격이면 <span lang=\"EN-US\">*</span>최고<span lang=\"EN-US\">*<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">오픈키친이라 조리과정을 직접 볼 수 있어 더욱 기억에 남는 것 같아요<span lang=\"EN-US\">.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">**</span>주의사항 <span lang=\"EN-US\">: ‘</span>오복수산<span lang=\"EN-US\">’</span>과 <span lang=\"EN-US\">‘</span>오복수산시장<span lang=\"EN-US\">’</span>은 다른\r\n가게이니<span lang=\"EN-US\">, </span>헷갈림 주의<span lang=\"EN-US\">**<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p><br></o:p></span></p>\r\n\r\n<!--EndFragment--><br>','2018-11-29 13:16:03',10,'서울특별시 마포구 성미산로 198','##카이센동맛집#해산물#카이센동#연남동#맛집#대박','오복수산'),(7,'yykim','[홍대] 윤씨밀방 _ 퓨전양식 맛집!!','\r\n\r\n\r\n\r\n\r\n\r\n\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:DrawingGridVertical