s=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><br style=\"clear:both;\"><img src=\"http://localhost:8090/editor/popup/upload/15434650691543465069788_yun2.jpg\" title=\"15434650691543465069788_yun2.jpg\"><br style=\"clear:both;\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><img src=\"http://localhost:8090/editor/popup/upload/15434650921543465092430_yun1.jpg\" title=\"15434650921543465092430_yun1.jpg\"><br style=\"clear:both;\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\">여러 번 가 본 가게인데<span lang=\"EN-US\">, </span>저는 갈 때마다 다른 메뉴를 주문하는 것\r\n같아요<span lang=\"EN-US\">!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">모든 메뉴를 맛보고 싶은 그런 가게<span lang=\"EN-US\">!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">주문한 메뉴가 나오기 전<span lang=\"EN-US\">, </span>식전빵인 <span lang=\"EN-US\">‘</span>올리브빵<span lang=\"EN-US\">’</span>과 떡볶이를 먹으며 기다려요<span lang=\"EN-US\">.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">올리브빵이랑 떡볶이는 부족하면 더 받을 수 있습니당<span lang=\"EN-US\">!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">(</span>올리브빵은 직접 만드신다고 해요<span lang=\"EN-US\">.\r\n</span>대박<span lang=\"EN-US\">)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">이 날은 <span lang=\"EN-US\">‘</span>텍스멕스 볼케이노 함박스테이크와 소보로덮밥<span lang=\"EN-US\">’</span>과 <span lang=\"EN-US\">‘</span>터키풍함박스테이크와 계란볶음밥<span lang=\"EN-US\">’</span>을\r\n주문했어요<span lang=\"EN-US\">. (</span>이름 긺 주의<span lang=\"EN-US\">…)<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">우선<span lang=\"EN-US\">, </span>윤씨밀방은 <span lang=\"EN-US\">1</span>인분\r\n양이 정말 호달달해요<span lang=\"EN-US\">.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">너무 맛있었지만<span lang=\"EN-US\">, </span>올리브빵이랑 떡볶이도 먹어서 너무 배부른 나머지\r\n조금 남겼<span lang=\"EN-US\">…<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">일반 파스타<span lang=\"EN-US\">, </span>스테이크 등 양식도 좋은데<span lang=\"EN-US\">, </span>뭔가 독특한 맛을 먹고 싶은 날<span lang=\"EN-US\">!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">윤씨밀방 추천 드려요 ♥<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">참고로 홍대 윤씨밀방은<span lang=\"EN-US\"> 1</span>호점<span lang=\"EN-US\">, 2</span>호점이\r\n있다고 해요<span lang=\"EN-US\">. </span>상황에 따라 <span lang=\"EN-US\">1</span>호점<span lang=\"EN-US\">, 2</span>호점 선택해서 방문하시면 좋을 것 같아요<span lang=\"EN-US\">~</span></p>\r\n\r\n<!--EndFragment--><br>','2018-11-29 13:18:16',37,'서울특별시 마포구 와우산로15길 15','##홍대맛집#홍대#상수맛집#핫플#파스타#JMT#퓨전양식','윤씨밀방'),(8,'yljm2','[구반포역] 애플하우스 _ 즉석 떡볶이 맛집!!','<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:DrawingGridVerticalSpacing>10 pt</w:DrawingGridVerticalSpacing>\r\n  <w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery>\r\n  <w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>KO</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:SpaceForUL/>\r\n   <w:BalanceSingleByteDoubleByteWidth/>\r\n   <w:DoNotLeaveBackslashAlone/>\r\n   <w:ULTrailSpace/>\r\n   <w:DoNotExpandShiftReturn/>\r\n   <w:AdjustLineHeightInTable/>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w