hansi-theme-font:minor-latin;\r\n	mso-font-kerning:1.0pt;}\r\n</style>\r\n<![endif]-->\r\n\r\n\r\n\r\n<!--StartFragment-->\r\n\r\n<p class=\"MsoNormal\">안녕하세용<span lang=\"EN-US\">! </span>오늘은 구반포역에 위치한 <span lang=\"EN-US\">‘</span>애플하우스<span lang=\"EN-US\">’ </span>소개해드릴게요<span lang=\"EN-US\">~!<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><img src=\"http://localhost:8090/editor/popup/upload/15435515381543551538416_banpo_2.jpg\" title=\"15435515381543551538416_banpo_2.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\">자세한 주소는 지도 첨부했으니까 참고해주세요<span lang=\"EN-US\">~<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">영업시간<span lang=\"EN-US\">&gt;&gt; 10:00~21:30<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">여러분 그거 아시죠<span lang=\"EN-US\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">별거 없는 것 같아 보이는데 뭔가 맛있는<span lang=\"EN-US\">, </span>자꾸 맛있는 그런 맛<span lang=\"EN-US\">!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">애플하우스 떡볶이가 딱 그런 맛인 것 같아요<span lang=\"EN-US\">!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">그리고 요즘 즉석 떡볶이 보다는 국물 떡볶이를 많이 먹는데<span lang=\"EN-US\">,<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">오랜만에 먹으니까 추억도 새록새록<span lang=\"EN-US\"> ~,.~<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><img src=\"http://localhost:8090/editor/popup/upload/15435515631543551563540_banpo_1.jpg\" title=\"15435515631543551563540_banpo_1.jpg\"><br style=\"clear:both;\"><br style=\"clear:both;\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\">수요미식회에도 소개된 맛집이라고 하네요<span lang=\"EN-US\">!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\">근처 사시는 분이나 들르시는 분들에게 추천 드리는 추억의 떡볶이 맛집입니당<span lang=\"EN-US\">~<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\"><img src=\"http://localhost:8090/editor/popup/upload/15435514271543551427378_banpo_3.jpg\" title=\"15435514271543551427378_banpo_3.jpg\"><br style=\"clear:both;\"><br>\r\n</span>앗<span lang=\"EN-US\">, </span>그리고 여러분 여기 무침 군만두 꼭 드세요<span lang=\"EN-US\">!! </span>꼭<span lang=\"EN-US\">!!!!<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\">(</span>솔직히 떡볶이 보다 더 맛있었다<span lang=\"EN-US\">!!!!)<o:p></o:p></span></p>\r\n\r\n<!--EndFragment--><br>','2018-11-30 13:18:18',4,'서울특별시 서초구 신반포로 50 구반포상가','##떡볶이맛집#수요미식회#애플하우스#구반포역#즉석떡볶이','애플하우스');
